import NavigationBar from './Navigationbar';
import { Jumbotron as Jumbo, Container } from 'react-bootstrap';

const Jumbotron = () => {
    return (
        <Jumbo className = "jumbotron">
            <div className="underlay">
                <NavigationBar />
                <Container className = "m-5 text-white">
                    <h1>Got a sick pup? He'll love us, I promise.</h1>
                    <p>
                        Lorem ipsum dolor sit amet consectetur adipisicing elit. Vel, rerum blanditiis suscipit non hic dicta consequatur culpa voluptates ut inventore! Lorem ipsum dolor sit amet consectetur adipisicing elit. Vel, rerum blanditiis suscipit non hic dicta consequatur culpa voluptates ut inventore!
                    </p>
                </Container>
            </div>
        </Jumbo>
    )
}

export default Jumbotron
